import * as React from 'react';
import classNames from 'classnames';

export default class LoginForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      active: 'login',
      surname: '',
      firstname: '',
      patronymic: '',
      email: '',
      password: '',
      onLogin: props.onLogin,
      onRegister: props.onRegister,
    };
  }

  onChangeHandler = (event) => {
    let name = event.target.name;
    let value = event.target.value;
    this.setState({ [name]: value });
  };

  onSubmitLogin = (e) => {
    this.state.onLogin(e, this.state.email, this.state.password);
  };

  onSubmitRegister = (e) => {
    this.state.onRegister(
      e,
      this.state.surname,
      this.state.firstname,
      this.state.patronymic,
      this.state.email,
      this.state.password
    );
  };

  render() {
    return (
      <div class = "max-w-screen-xl mx-auto mt-12" >
      <div class="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-4" role="alert">
   <strong class="font-bold">Ошибка: </strong>
   <span class="block sm:inline">
     Некорректные данные. Пожалуйста, проверьте правильность ввода данных.
   </span>
 </div>
 <div class="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
 <strong class="font-bold">Ошибка: </strong>
 <span class="block sm:inline">
   На данный номер телефона уже зарегистрирован аккаунт. Пожалуйста, используйте другой номер телефона для регистрации или попробуйте использовать вход.
 </span>
 </div>
   <form class="max-w-lg mx-auto mt-12 p-6 bg-gray-200 rounded-lg shadow-md" action="#" method="POST">
   <h2 class="text-2xl font-semibold text-gray-700 mb-6">Регистрация</h2>
   <div class="mb-4">
     <label class="block text-gray-700 font-bold mb-2" for="last-name">
       Фамилия
     </label>
     <input class="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="last-name" type="text" placeholder="Введите фамилию" required/>
   </div>
   <div class="mb-4">
     <label class="block text-gray-700 font-bold mb-2" for="first-name">
       Имя
     </label>
     <input class="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="first-name" type="text" placeholder="Введите имя" required/>
   </div>
   <div class="mb-4">
     <label class="block text-gray-700 font-bold mb-2" for="patronymic">
       Отчество
     </label>
     <input class="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="patronymic" type="text" placeholder="Введите отчество" required/>
   </div>
   <div class="mb-4">
     <label class="block text-gray-700 font-bold mb-2" for="phone">
       Телефон
     </label>
     <input class="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="phone" type="tel" placeholder="Введите телефон" required/>
   </div>
   <div class="mb-6">
     <label class="block text-gray-700 font-bold mb-2" for="password">
       Пароль
     </label>
     <input class="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="password" type="password" placeholder="Введите пароль" required/>
   </div>
   <div class="flex items-center justify-between">
     <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="submit">
       Зарегистрироваться
     </button>
   </div>
   <p class="mt-4 text-gray-600">Уже зарегистрированы? <a href="/authorize" class="text-blue-600">Войдите в систему</a></p>
 </form>
 </div>
 
    );
  }
}
